import React from 'react';
import {
  ChakraProvider,
  theme
} from '@chakra-ui/react';
import { Fade, ScaleFade, Slide, SlideFade, Button, Collapse, Box, useDisclosure } from '@chakra-ui/react'
import "./Footer.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome, faUserGroup, faCirclePlus, faCompass, faUser } from "@fortawesome/free-solid-svg-icons";
import { Link } from 'react-router-dom';

const Footer = () => {
  const { isOpen, onToggle } = useDisclosure()
    return (
        <ChakraProvider theme={theme}>
            <header className='footer'>
                <Link to='/'><div className='home'><FontAwesomeIcon icon={faHome} /></div></Link>
                <Link to='/running-crew-list'><div className='gather'><FontAwesomeIcon icon={faUserGroup} /></div></Link>
                {/* <Link to='/create-feed'> */}
                  <div className='post' onClick={onToggle}><FontAwesomeIcon icon={faCirclePlus} /></div>
                  <Collapse in={isOpen} animateOpacity>
                    <Box
                      p='40px'
                      color='white'
                      mt='4'
                      bg='teal.500'
                      rounded='md'
                      shadow='md'
                    >
                    </Box>
                </Collapse>
                {/* </Link> */}
                <div className='navigate'><FontAwesomeIcon icon={faCompass} /></div>
                <div className='my-page'><FontAwesomeIcon icon={faUser} /></div>
            </header>
        </ChakraProvider>
      );
}

export default Footer;
